import dynamic from "next/dynamic";

const DynamicComponentWithNoSSR = dynamic(() => import("../components/Piano"), {
  ssr: false,
});

function App() {
  return (
    <div>
      <DynamicComponentWithNoSSR />
      <p>App PAGE is here!</p>
    </div>
  );
}

export default App;
